import React from 'react'
import {Link} from 'react-router-dom'

export default function Button({label, path, del}) {
    return (
        <>
            {path && 
            <button>
                <Link to={path}>
                    {label}
                </Link>
            </button>
            }
            {del && 
            <button>
                <Link to={path}>
                    {label}
                </Link>
            </button>
            }

            
        </>
    )
}
